text:
{'text': 'I just need to say; the atmosphere and service has detrimentally declined. To be objective, I have been going there quite often in the past 2 years. When I first went there, it was quite good. The dancers especially were professional, kind and they could dance really well.

However, right now, it has been such a drop in terms of service. You may still head there for a fun and chill night but my 2 cents worth of advice is to not expect too much.

A heads up: the female Indian manager, whose name is babita, is basically not a very nice person. She was quite rude and sarcastic.', 'languageCode': 'en'}

